import React from 'react'
import Dropdown from "react-bootstrap/Dropdown";
import DropdownButton from "react-bootstrap/DropdownButton";
import { Link } from 'react-router-dom';
import Hamburger from 'hamburger-react'

const Menu = () => {
  return (
    <div className="menuDropdown">

    <DropdownButton variant="third" id="dropdown-item-button">
    <Hamburger>
      <Link className='link' to="/o-nas"><Dropdown.Item className="menuBtn" as="button">O nas</Dropdown.Item></Link>
      <Link className='link' to="/kalendarz"><Dropdown.Item className="menuBtn" as="button">Kalendarz</Dropdown.Item></Link>
      <Link className='link' to="/ustawienia-konta"><Dropdown.Item className="menuBtn" as="button">Ustawienia konta</Dropdown.Item></Link>
      <Link className='link' to="/pomoc"><Dropdown.Item className="menuBtn" as="button">Pomoc</Dropdown.Item></Link>   
    </Hamburger>

    </DropdownButton>
  </div>      
  )
}

export default Menu
